const Whoarewe = () => {
    return (
        <div>
            <h1>
                The FASHIONISTA Story
            </h1>
            <p>
            Fashionistas are individuals who have a keen interest in fashion and style. They are passionate about clothing, accessories, and fashion trends, and they stay up-to-date with the latest fashion news and styles. Fashionistas are often viewed as trendsetters and influencers, and they may work in fashion-related fields, such as fashion design, modeling, styling, or fashion journalism. They may also simply enjoy fashion as a hobby or personal interest and may express their style through their clothing, accessories, and personal appearance. Overall, fashionistas are individuals who appreciate and prioritize fashion and style in their lives.
            </p>
            <p>
            The mission of a fashion brand or retailer typically reflects their goals, values, and purpose. The mission may focus on various aspects of the fashion industry, such as designing and producing high-quality and stylish clothing, promoting sustainable and ethical fashion practices, or providing affordable and accessible fashion for a broad audience.

Fashion brands and retailers may also have additional goals beyond just selling clothing, such as supporting social causes or empowering their customers through fashion. For example, a brand might partner with a nonprofit organization to donate a portion of their profits to a specific cause or provide job opportunities for underrepresented communities in the fashion industry.

Overall, the mission of a fashion brand or retailer can vary depending on their focus and priorities, but it typically reflects their values and vision for the role of fashion in society.
            </p>
        </div>
    );
};
export default Whoarewe;
